import React from 'react';
import './style.css'

function Square({vlaue}){
    return(
        <button className='square'>{vlaue}</button>
    )
}

function Board() {
    return (
        <div>
            <div className='board-row'>
                <Square vlaue='1'/>
                <Square vlaue='2'/>
                <Square vlaue='3'/>
            </div>
            <div className='board-row'>
                <Square vlaue='4'/>
                <Square vlaue='5'/>
                <Square vlaue='6'/>
            </div>
            <div className='board-row'>
                <Square vlaue='7'/>
                <Square vlaue='8'/>
                <Square vlaue='9'/>
            </div>
        </div>
    )
  }

  export default function App(){
    return(
        <Board/>
    )
  }
